    wow2 += "							<p class=\"p1\">Le fasi lunari sono un vero e proprio concentrato di energia. In tutto <b>sono 8<\/b> e ogni mese ci regalano splendidi scenari e <b>una carica magica di emozioni<\/b> e vitalitÃ .<\/p><p class=\"p1\">La saggezza popolare gli ha sempre attribuito una grande importanza, affidando alle fasi lunari attivitÃ  fondamentali per la cura delle piante e delle persone.<\/p><p class=\"p1\">Ispirandosi alla magia della Luna, Yasmin Boland ti guida a <b>celebrare il tuo potere personale<\/b> e a creare cambiamenti positivi e duraturi in ogni ambito.<\/p><p class=\"p1\">Con generositÃ  e passione <b>Yasmin ti dona tutta la sua esperienza<\/b> per insegnarti a lavorare con le energie lunari e rafforzare la tua capacitÃ  di manifestare per realizzare consapevolmente la vita dei tuoi sogni.<\/p><p class=\"p1\">Nel <b>corso completo<\/b> disponibile in italiano e in inglese, chiaro e <b>ricco di informazioni<\/b>, scoprirai le 8 fasi magiche del ciclo lunare e capirai come interagiscono con le energie dei 12 segni dello Zodiaco. Conoscerai i segni che governano <b>il tuo tema natale<\/b> e riceverai validi consigli per utilizzarne tutte le potenzialitÃ .<\/p><p class=\"p1\">Scoprirai che la Luna non Ã¨ solo un âsempliceâ satellite, ma Ã¨ un vero e proprio <b>Timer Cosmico<\/b> che ti permette di pianificare ogni evento e di <i>scorgere il futuro oltre i confini del tempo<\/i>, per <b>creare la tua vita migliore<\/b> e aiutare le persone che si affidano alla tua sensibilitÃ  a fare lo stesso.<\/p>						<\/div>";
