    wow2 += "							<p class=\"p1\">Gli antichi naviganti per orientarsi guardavano il cielo. Il Sole, la Luna e le Stelle costituivano una mappa naturale a cui affidarsi durante le lunghe traversate da un continente allâaltro.<span class=\"Apple-converted-space\">&nbsp; &nbsp;<\/span><\/p><p class=\"p1\">In questo <b>viaggio di MoonologyÂ®<\/b> la Luna sarÃ  la tua bussola dâoro, il <b>Timer Cosmico<\/b> che imparerai a usare per attrarre tutto ciÃ² che di bello e di buono desideri per la tua vita.<\/p><p class=\"p1\">Con Yasmin al tuo fianco <b>scopri il lato magico della Luna<\/b> e intraprendi un viaggio emozionante alla conquista del <b>benessere<\/b> e della <b>realizzazione personale<\/b>.<\/p><p class=\"p1\">In maniera semplice e divertente impari a <b>interagire con le energie dellâUniverso<\/b> e a lavorare con <b>i superpoteri che la Luna ti regala<\/b> ogni giorno, soprattutto durante gli eventi speciali come <i>Eclissi, Lune Blu <\/i>e <i>Superlune.<\/i>&nbsp;<\/p><p class=\"p1\">Al termine del corso avrai acquisito le conoscenze<b> <\/b>piÃ¹ approfondite<b> <\/b>e gli strumenti piÃ¹ performanti per diventare un <b>esperto di energie lunari certificato<\/b> e portare il sapere <b>MoonologyÂ® <\/b>nel mondo. Potrai <b>condurre le cerimonie<\/b> della Luna Nuova e della Luna Piena, <b>tenere seminari<\/b>, fare letture mirate e <b>condividere la magia della Luna<\/b> con tutte le persone che si affideranno alla tua lunare sensibilitÃ .<\/p><p class=\"p1\">Trasforma adesso la tua vita e rendila speciale!<\/p>						<\/div>";
